The method placeToWidget(target) does not work of the target widget was not yet rendered.

This issue can be reproduced by the following playground code:

-- ------------------------------------------------------------
var mybutton = new qx.ui.form.Button("Button");

this.getRoot().add(mybutton,  {left : 100, top  : 50});

var mypopup = new qx.ui.popup.Popup(new qx.ui.layout.Canvas());
var mylabel = new qx.ui.basic.Label("Tooltip text");
mylabel.set({backgroundColor: "red", minWidth: 200, minHeight: 50});
mypopup.add(mylabel);

mypopup.placeToWidget(mybutton);
mypopup.show();
-- ------------------------------------------------------------

The result of this playground code can be seen in the attached screenshot.
I would expect that the popup is placed to the button, but the popup is placed in the top left border of the browser.

I just checked out the documentation which describes this limitation of the placeToWidget method like this:

Places the widget to another (at least laid out) widget. The DOM element is not needed, but the bounds are needed to compute the location of the widget to align to.

Additionally, the method returns a boolean if the placement works as expected.

So the given sample could be fixed like this:


var mybutton = new qx.ui.form.Button("Button");

this.getRoot().add(mybutton,  {left : 100, top  : 50});

var mypopup = new qx.ui.popup.Popup(new qx.ui.layout.Canvas());
var mylabel = new qx.ui.basic.Label("Tooltip text");
mylabel.set({backgroundColor: "red", minWidth: 200, minHeight: 50});
mypopup.add(mylabel);

if (!mypopup.placeToWidget(mybutton)) {
  mybutton.addListenerOnce("appear", function() {
    mypopup.placeToWidget(mybutton);
  });
}
mypopup.show();


I am not sure if we need a solution in the framework for that because this could be tricky to add / remove the listeners in every possible scenario (multiple calls of placeToWidget e.g.).
